import React, { Component } from "react";
import "./Main.css";
import Booklist from "../Booklist/Index";

class Main extends Component {
    render() {
      const { books } = this.props;
      console.log(books);
      return (

        <main className="appMain row">
        <div className="left_app col-md-2">
          <p className="texto1">que tal majo</p>
        </div>
         <Booklist books ={books}/>
        </main>
      );
    }
};


export default Main;
